import React, { useState } from 'react';
import './SearchBar.css';
import { MagnifyingGlassCircleIcon } from '@hero'

function SearchBar() {
    const [search, setSearch] = useState('Type here for the song')

    return(
        <div className="searchBar">
            <form className="search">
                <input 
                    type="text"
                    placeholder="Type here for the song"
                    name="searchInput"
                    className="searchInput">
                </input> 
                <input 
                    type="submit" 
                    name="submit" 
                    className="submit" 
                    value="">
                </input>
            </form>
            
        </div>
    )
};

export default SearchBar;
